import React, {Component} from 'react';
import Competencias from '../../components/Competencias/ListaBlocoConteudo';
import { competenciasTecnicasData } from '../../Configs/competenciasData';


class Home extends Component{
    render(){
        return (
            <div>
                <Competencias items={competenciasTecnicasData} />
            </div>
        );
    }
}

export default Home;
